class Submission:
    def __init__(self, submission_id, data):
        self.submission_id = submission_id
        self.data = data
        self.errors = []

    def validate(self):
        if not self.validate_submission_id():
            self.errors.append("Invalid Submission ID format.")
            return False
        if not self.data:
            self.errors.append("Submission data cannot be empty.")
            return False
        return True

    def validate_submission_id(self):
        return isinstance(self.submission_id, str) and len(self.submission_id) == 10

    def get_errors(self):
        return self.errors


class SubmissionManager:
    def __init__(self):
        self.submissions = []
        self.activity_log = []

    def upload_submission(self, submission_id, data):
        submission = Submission(submission_id, data)
        if submission.validate():
            self.submissions.append(submission)
            self.log_activity(f"Submission {submission_id} uploaded successfully.")
            return True
        else:
            self.log_activity(f"Submission {submission_id} failed validation: {submission.get_errors()}")
            return submission.get_errors()

    def log_activity(self, message):
        self.activity_log.append(message)

    def get_activity_log(self):
        return self.activity_log

    def delete_old_submissions(self, date):
        before_count = len(self.submissions)
        self.submissions = [sub for sub in self.submissions if sub.data['date'] >= date]
        after_count = len(self.submissions)
        self.log_activity(f"Deleted {before_count - after_count} submissions before {date}.")

    def process_flexfields(self, submission_id, flexfields):
        submission = self.find_submission(submission_id)
        if submission and isinstance(flexfields, dict):
            submission.data.update(flexfields)
            self.log_activity(f"Flexfields added to submission {submission_id}.")
            return True
        return False

    def find_submission(self, submission_id):
        for submission in self.submissions:
            if submission.submission_id == submission_id:
                return submission
        return None

    def get_errors_for_submission(self, submission_id):
        submission = self.find_submission(submission_id)
        if submission:
            return submission.get_errors()
        return []


class TestingCoordinator:
    def __init__(self):
        self.testing_results = []

    def report_testing_results(self, submission_id, results):
        self.testing_results.append({"submission_id": submission_id, "results": results})

    def get_testing_results(self):
        return self.testing_results


class Developer:
    def __init__(self):
        self.validation_rules = {}

    def update_validation_rules(self, rule_name, rule):
        self.validation_rules[rule_name] = rule
        self.log_activity(f"Updated validation rule: {rule_name}")

    def log_activity(self, message):
        print(message)


# Example Usage
if __name__ == "__main__":
