    result = submission_manager.upload_submission("1234567890", {"data": "Sample data", "date": "2023-10-01"})
    print(result)

    # Checking activity log
    print(submission_manager.get_activity_log())

    # Reporting testing results
    testing_coordinator.report_testing_results("1234567890", {"status": "Success", "feedback": "Good job!"})
    print(testing_coordinator.get_testing_results())

    # Deleting old submissions
    submission_manager.delete_old_submissions("2023-09-30")
    print(submission_manager.get_activity_log())

    # Adding flexfields
    submission_manager.process_flexfields("1234567890", {"flexfield1": "value1"})
    print(submission_manager.get_activity_log())

    # Checking errors for a submission
    errors = submission_manager.get_errors_for_submission("1234567890")
